.products {
    padding-top: 121px;
    padding-bottom: 98px;
    text-align: center;

    @media screen and (min-width: 768px) {
        padding-top: 122px;
        padding-bottom: 112px;
    }

    @media screen and (min-width: 1280px) {
        padding-top: 127px;
        padding-bottom: 119px;
    }
}

.products-title {
    margin-bottom: 144px;

    font-size: 34px;
    line-height: 1.147;
    letter-spacing: 0.04em;
    text-transform: uppercase;

    color: $first-title-color;

    @media screen and (min-width: 768px) {
        margin-bottom: 150px;

        font-size: 48px;
    }

    @media screen and (min-width: 1280px) {
        margin-bottom: 259px;

        font-size: 58px;
        line-height: 1.138;
        letter-spacing: 0.06em;
    }
}

.products-subtitle {
    margin-bottom: 15px;

    font-family: $title-font, sans-serif;
    font-weight: 400;
    font-size: 18px;
    line-height: 1.167;
    text-transform: uppercase;

    color: $second-title-color;

    @media screen and (min-width: 768px) {
        font-size: 26px;
        line-height: 1.15;
    }

    @media screen and (min-width: 1280px) {
        font-size: 30px;
        line-height: 1.133;
        letter-spacing: 0.04em;
    }
}

.products-item {
    margin-bottom: 30px;

    line-height: 1.15;
    letter-spacing: 0.04em;
    text-transform: uppercase;

    color: $third-text-color;

    @media screen and (min-width: 1280px) {
        margin-bottom: 32px;

        font-size: 30px;
        line-height: 1.133;
    }
}

.products-description {
    margin-bottom: 30px;
    padding: 0px 40px;

    font-family: $main-text-font, sans-serif;
    font-weight: 700;
    font-size: 14px;
    line-height: 1.52;
    letter-spacing: 0.04em;

    color: $third-text-color;

    @media screen and (min-width: 768px) {
        margin-bottom: 40px;
        padding: 0px 11px;
        line-height: 1.76;
    }

    @media screen and (min-width: 1280px) {
        margin-bottom: 62px;
        padding: 0px 44px;
        font-size: 16px;
    }
}

.products-description-hidden {
    @media screen and (min-width: 768px) {
        display: none;
    }
}

.prodacts-cardset {
    
    @media screen and (min-width: 768px) {
        display: flex;
        margin: 0px -10px;
    }

    @media screen and (min-width: 1280px) {
        margin: 0px -15px;
    }
}

.product-card {
    position: relative;
    padding-top: 161px;
    border-radius: 24px;

    &:not(:last-child) {
        @media screen and (max-width: 767px) {
            margin-bottom: 130px;
        }
    }

    &:nth-child(n + 1) {
        background-color: $product-contant-container-1;
    }

    &:nth-child(n + 2) {
