.footer-text {
  @media screen and (max-width: 767px) {
    width: 234px;
    margin-bottom: 43px;
  }
  @media screen and (min-width: 768px) {
    margin-right: 92px;
    width: 340px;
  }

  @media screen and (min-width: 1280px) {
    margin-right: 257px;
    width: 450px;
  }
}

.toptext {
  font-family: Titan One;
  font-style: normal;
  font-weight: normal;
  font-size: 18px;
  line-height: 1.166;
  text-transform: uppercase;
  color: $second-title-color;

  @media screen and (max-width: 767px) {
    margin-bottom: 17px;
  }
  @media screen and (min-width: 768px) {
    margin-bottom: 15px;
    font-size: 26px;
    line-height: 1.153;
  }
