.lowertext {
  font-family: Titan One;
  font-style: normal;
  font-weight: normal;
  font-size: 34px;
  line-height: 1.147;
  letter-spacing: 0.04em;
  text-transform: uppercase;
  color: $first-title-color;

  @media screen and (min-width: 768px) {
    font-size: 48px;
    line-height: 1.145;
  }
  @media screen and (min-width: 1280px) {
    font-size: 54px;
    line-height: 1.137;
  }
