.contacts-icon__list {
  display: flex;
  justify-content: flex-end;

  margin-bottom: 46px;
}
.contacts-icon__item {
  margin-right: 28px;
  &:last-child {
    margin-right: 0;
  }
  display: flex;
  justify-content: center;
  align-items: center;

  border-radius: 50%;
  width: 32px;
  height: 32px;
  background-color: $second-title-color;
  transition: all 250ms ease;
  &:hover {
    background-color: #d41443;
  }
