.contacts-tel {
  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 12px;
  line-height: 1.86;
  text-align: right;
}
.tel-number {
  color: $first-title-color;
  text-decoration: none;
  margin-left: 1px;
}
.copyright {
  text-align: center;
}
.copyright-text {
  padding-top: 22px;
  padding-bottom: 23px;

  font-family: DM Sans;
  font-style: normal;
  font-weight: bold;
  font-size: 14px;
  line-height: 1.52;
  color: $second-text-color;

  @media screen and (max-width: 767px) {
    white-space: pre-line;
  }
  @media screen and (min-width: 768px) {
    padding-top: 29px;
    padding-bottom: 18px;
  }
  @media screen and (min-width: 1280px) {
    padding-top: 9px;
    padding-bottom: 10px;
  }
}
